  namespace: SuperOffice.CRM.Cache
  summary: "\nGet one single pricelist, based on sale Id and erpPriceListKey. This call may cause the Quote Connector\nto be called, so has quite variable latency.\n"
  syntax:
    content: public PriceListInfo GetPriceListInfo(int saleId, string erpPriceListKey)
    parameters:
    - id: saleId
      type: System.Int32
      description: Id of the sale; this sale must have a Quote, from which we derive the quote connection id
    - id: erpPriceListKey
      type: System.String
      description: Key identifying the desired price list
    return:
      type: SuperOffice.CRM.PriceListInfo
      description: Pricelist info, or null if the key or other parameters do not match
